function transformData(oldData) {
    // Top-level structure, including your default config
    const newData = {
        routes: []
    };

    const regionMap = new Map();

    if (!oldData || !Array.isArray(oldData.data)) {
        return newData;
    }

    oldData.data.forEach(route => {
        // 1) Only published routes
        if (!route || route.Published !== true) {
            return;
        }

        const fromStation = route.From_Station;
        const toStation = route.To_Station;

        // 2) If from/to system is null or missing, skip this route
        if (
            !fromStation ||
            !fromStation.System ||
            !fromStation.System.Region ||
            !toStation ||
            !toStation.System ||
            !toStation.System.Region
        ) {
            return;
        }

        const fromSystemObj = fromStation.System;
        const toSystemObj = toStation.System;

        const fromRegionName = fromSystemObj.Region.Region;
        const fromSystemName = fromSystemObj.System;
        const fromStationName = fromStation.Station;

        const toRegionName = toSystemObj.Region.Region;
        const toSystemName = toSystemObj.System;
        const toStationName = toStation.Station;

        const pricing = route.Pricing;
        if (!pricing || !pricing.Reward || !pricing.Limit) {
            // If pricing is malformed, skip this route as well
            return;
        }

        const reward = pricing.Reward;
        const limits = pricing.Limit;
        const allowRush = !!route.AllowRush;

        const targetStation = {
            system: toSystemName,
            station: toStationName,
            reward: {
                volume: parseFloat(reward.Volume),
                collateral: parseFloat(reward.Collateral)
            },
            limits: {
                volume: parseFloat(limits.Volume),
                collateral: parseFloat(limits.Collateral)
            },
            minimumReward: parseInt(reward.Minimum, 10),
            allowRush: allowRush
        };

        // Include overrideRushFeeAmount if present and numeric
        if (route.OverrideRushFeeAmount != null && route.OverrideRushFeeAmount !== "") {
            const fee = parseFloat(route.OverrideRushFeeAmount);
            if (!Number.isNaN(fee)) {
                targetStation.overrideRushFeeAmount = fee;
            }
        }

        // --- Region / system aggregation (same logic as before, just guarded) ---

        if (!regionMap.has(fromRegionName)) {
            regionMap.set(fromRegionName, {
                region: fromRegionName,
                systems: new Map()
            });
        }

        const fromRegion = regionMap.get(fromRegionName);

        if (!fromRegion.systems.has(fromSystemName)) {
            fromRegion.systems.set(fromSystemName, {
                system: fromSystemName,
                station: fromStationName,
                regions: new Map()
            });
        }

        const fromSystem = fromRegion.systems.get(fromSystemName);

        if (!fromSystem.regions.has(toRegionName)) {
            fromSystem.regions.set(toRegionName, {
                region: toRegionName,
                systems: []
            });
        }

        const toRegion = fromSystem.regions.get(toRegionName);
        toRegion.systems.push(targetStation);
    });

    // Build final structure from the maps into arrays
    regionMap.forEach(region => {
        const regionEntry = {
            region: region.region,
            systems: []
        };

        region.systems.forEach(system => {
            const systemEntry = {
                system: system.system,
                station: system.station,
                regions: []
            };

            system.regions.forEach(subRegion => {
                systemEntry.regions.push({
                    region: subRegion.region,
                    systems: subRegion.systems
                });
            });

            regionEntry.systems.push(systemEntry);
        });

        newData.routes.push(regionEntry);
    });

    return newData;
}

