// Hard-coded fallback default
const fallbackDefault = {
    region: "The Forge",
    system: "Jita",
    fees: {
        rushFeeAmount: 150000000
    }
};

// Safely read values from payload
const data = msg.payload && msg.payload.data ? msg.payload.data : {};
const defaultSystem = data.Default_System || {};
const defaultRegionObj = defaultSystem.Region || {};

const region = defaultRegionObj.Region;
const system = defaultSystem.System;
const rushRaw = data.RushDeliveryAmount;
const rushFeeAmount = rushRaw != null ? parseFloat(rushRaw) : NaN;

// If *anything* is null/invalid, use the hard-coded default
if (
    region == null ||
    system == null ||
    rushRaw == null ||
    !isFinite(rushFeeAmount)
) {
    msg.data.default = fallbackDefault;
} else {
    msg.data.default = {
        region: region,
        system: system,
        fees: {
            rushFeeAmount: rushFeeAmount
        }
    };
}

// Construct payload with default at the top, followed by the rest
msg.payload = {
    default: msg.data.default,
    routes: msg.data.routes
};

return msg;

